import { createStore } from 'redux';
import Reducer from './Reducer';

const intialState = {
  items: [
      { id: 1, name: 'OOP' },
      { id: 2, name: 'Javascript' },
      { id: 3, name: 'C++' },
  ],
  doneItems: [
    { id: 1, name: 'JQuery' },
  ],
  AddItem:{
    id:'',
    name:''
  }

}


const store = createStore(Reducer, intialState, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export default store;
